chrome.runtime.onInstalled.addListener(()=>{chrome.storage.local.get(["snippets"],e=>{e.snippets||chrome.storage.local.set({snippets:[]})})});chrome.runtime.onMessage.addListener((e,r,s)=>{if(e.type==="GET_SNIPPETS")return chrome.storage.local.get(["snippets"],t=>{s({snippets:t.snippets||[]})}),!0});
